const useStyles = makeStyles(theme => ({
    content:{
        background: "",
    }

}));



const Project = () => {
    const classes = useStyles();
    return(
        <main className={classes.content}>
            <ResponsiveDrawer/>
            <div className={classes.des}>
                <p className="mb-4"> ---- Here's what I've done so far. ----</p>

            </div>
        </main>

    );
}

export default Project;
